from rest_framework.test import APITestCase, APIRequestFactory, force_authenticate
from rest_framework.views import APIView
from typing import Callable
from types import MethodType



def request_generic_asset_test_suite(*,
        test_suite_name: str, #BoardLikeTests
        platform_name: str, #boards
        parent_resource: str, #board
        parent_resource_creator: Callable, #create_random_board
        parent_resource_identifier: str, #bid
        platform_base_url:str, #/boards
        asset_name: str, #likes
        user_creation_callable, #create_random_user
        profile_creation_callable, #create_user_profile
        view: APIView, #BoardLikesView
        parent_module: str, #__name__
        linguistic_parameters: dict
):
    #method creation step
    def setUp(self: APITestCase):
        self.user, _, _ = user_creation_callable()
        self.profile, _ = profile_creation_callable(self.user)
        self.factory = APIRequestFactory()
        setattr(self, parent_resource, parent_resource_creator())


    def test_user_can_create_asset_on_valid_parent(self: APITestCase):
        request = self.factory.post(
            '{platform_base_url}/{parent}/{asset_name}/'.format(
            parent=getattr(self, parent_resource).pk,
            platform_base_url=platform_base_url,
            asset_name=asset_name)
        )
        force_authenticate(request, self.user)
        response = view.as_view()(request, **{parent_resource_identifier:getattr(self, parent_resource).pk}).render()
        self.assertEqual(201, response.status_code)
        self.assertIn('code', response.data)
        self.assertEqual(201, response.data['code'])


    def test_user_cannot_create_asset_on_invalid_parent(self: APITestCase):
        fake_parentid = 2345098
        request = self.factory.post(
            '{platform_base_url}/{parent}/{asset_name}/'.format(
                parent=fake_parentid,
                platform_base_url=platform_base_url,
                asset_name=asset_name)
        )
        force_authenticate(request, self.user)
        response = view.as_view()(request, **{parent_resource_identifier: fake_parentid}).render()
        self.assertEqual(404, response.status_code)
        self.assertIn('code', response.data)
        self.assertEqual(404, response.data['code'])


    def test_user_cannot_create_asset_twice(self: APITestCase):
        temp_parent = parent_resource_creator()
        request = self.factory.post(
            '{platform_base_url}/{parent}/{asset_name}/'.format(
                parent=temp_parent.pk,
                platform_base_url=platform_base_url,
                asset_name=asset_name)
        )
        force_authenticate(request, self.user)
        response = view.as_view()(request, **{parent_resource_identifier: temp_parent.pk})
        self.assertEqual(201, response.status_code)
        self.assertIn('code', response.data)
        self.assertEqual(201, response.status_code)
        response = view.as_view()(request, **{parent_resource_identifier: temp_parent.pk})
        self.assertEqual(400, response.status_code)
        self.assertIn('code', response.data)
        self.assertEqual(400, response.data['code'])


    def test_user_can_delete_asset_after_creation(self: APITestCase):
        temp_parent = parent_resource_creator()
        request = self.factory.post(
            '{platform_base_url}/{parent}/{asset_name}/'.format(
                parent=temp_parent.pk,
                platform_base_url=platform_base_url,
                asset_name=asset_name)
        )
        force_authenticate(request, self.user)
        response = view.as_view()(request, **{parent_resource_identifier: temp_parent.pk})
        self.assertEqual(201, response.status_code)
        self.assertIn('code', response.data)
        self.assertEqual(201, response.status_code)
        request = self.factory.delete(
            '{platform_base_url}/{parent}/{asset_name}/'.format(
                parent=temp_parent.pk,
                platform_base_url=platform_base_url,
                asset_name=asset_name)
        )
        force_authenticate(request, self.user)
        response = view.as_view()(request, **{parent_resource_identifier: temp_parent.pk})
        self.assertEqual(204, response.status_code)
        self.assertIn('code', response.data)
        self.assertEqual(204, response.data['code'])


    def test_user_cannot_delete_asset_if_it_does_not_exist(self: APITestCase):
        temp_parent = parent_resource_creator()
        request = self.factory.delete(
            '{platform_base_url}/{parent}/{asset_name}/'.format(
                parent=temp_parent.pk,
                platform_base_url=platform_base_url,
                asset_name=asset_name)
        )
        force_authenticate(request, self.user)
        response = view.as_view()(request, **{parent_resource_identifier: temp_parent.pk})
        self.assertEqual(400, response.status_code)
        self.assertIn('code', response.data)
        self.assertEqual(400, response.data['code'])


    def test_creating_the_asset_requires_authentication(self: APITestCase):
        temp_parent = parent_resource_creator()
        request = self.factory.post(
            '{platform_base_url}/{parent}/{asset_name}/'.format(
                parent=temp_parent.pk,
                platform_base_url=platform_base_url,
                asset_name=asset_name)
        )
        response = view.as_view()(request, **{parent_resource_identifier: temp_parent.pk})
        self.assertEqual(401, response.status_code)
        self.assertIn('code', response.data)
        self.assertEqual(401, response.data['code'])


    #class creation step
    name = test_suite_name
    parents = tuple([APITestCase])
    class_dict = {
        '__module__' : parent_module,
        '__qualname__' : test_suite_name,
        'setUp' : setUp,
        'test_{owner}_can_{verb}_existing_{parent}'.format(**linguistic_parameters) : test_user_can_create_asset_on_valid_parent,
        'test_{owner}_cannot_{verb}_non_existing_{parent}'.format(**linguistic_parameters) : test_user_cannot_create_asset_on_invalid_parent,
        'test_{owner}_cannot_{verb}_the_same_{parent}_twice'.format(**linguistic_parameters) : test_user_cannot_create_asset_twice,
        'test_{owner}_can_{opposite_verb}_after_{exercise_verb}'.format(**linguistic_parameters) : test_user_can_delete_asset_after_creation,
        'test_{owner}_cannot_{opposite_verb}_they_do_not_{verb}'.format(**linguistic_parameters) :  test_user_cannot_delete_asset_if_it_does_not_exist,
        'test_{exercise_verb}_requires_authentication'.format(**linguistic_parameters) : test_creating_the_asset_requires_authentication,

    }
    test_suite = type(name, parents, class_dict)
    return test_suite

